import React from "react";
import { Route } from "react-router";

const LayoutHome = (props) => {
  return (
    <>
      456
      {props.children}
    </>
  );
};

const HomeTemplate = ({ Component, ...props }) => {
  return (
    <Route
      {...props}
      render={(propsComponent) => {
        <LayoutHome>
          <Component {...propsComponent} />
        </LayoutHome>;
      }}
    />
  );
};

export default HomeTemplate;
